import App from 'next/app'
import Navbar from '../components/navbar'

function MyApp({ Component, pageProps }) {
    return (
    <Component {...pageProps}> 
        <Navbar loggedIn = {false} accountName = {'go4johne'} userID = {1234} />
    </Component>
    )
  }

  export default MyApp
